int main ()
{
  double EE_1_1 = 0.38676;double EE_1_2 = 0.33638;double EE_1_3 = 0.042791;

  boost::shared_ptr<testRobotDirect<roboptim::EigenMatrixDense> > endEffCstr =
    boost::make_shared<testRobotDirect<roboptim::EigenMatrixDense> > (EE_1_1, EE_1_2, EE_1_3);

  // Create Null Cost Function
  roboptim::Function::vector_t offset (10);
  for(std::size_t i=0; i<10; ++i)
    offset[i] = 0.;
  roboptim::ConstantFunction cost(offset);

  //Create problem
  solver_t::problem_t pb (cost);

  // Set bounds for all optimization parameters
  pb.argumentBounds ()[0] = roboptim::Function::makeInterval (-3.15, 3.15);
	pb.argumentBounds ()[1] = roboptim::Function::makeInterval (-3.15, 3.15);
	pb.argumentBounds ()[2] = roboptim::Function::makeInterval (-3.15, 3.15);
	pb.argumentBounds ()[3] = roboptim::Function::makeInterval (-3.15, 3.15);
	pb.argumentBounds ()[4] = roboptim::Function::makeInterval (-3.15, 3.15);
	pb.argumentBounds ()[5] = roboptim::Function::makeInterval (-3.15, 3.15);
	pb.argumentBounds ()[6] = roboptim::Function::makeInterval (-3.15, 3.15);
	pb.argumentBounds ()[7] = roboptim::Function::makeInterval (-3.15, 3.15);
	pb.argumentBounds ()[8] = roboptim::Function::makeInterval (-3.15, 3.15);
	pb.argumentBounds ()[9] = roboptim::Function::makeInterval (-3.15, 3.15);

  // Set the starting point.
  roboptim::Function::vector_t start (10);
  start[0] = 0.75961;
	start[1] = 0.49711;
	start[2] = 0.89854;
	start[3] = 0.36785;
	start[4] = 0.87748;
	start[5] = 0.082372;
	start[6] = 0.82867;
	start[7] = 0.40989;
	start[8] = 0.9299;
	start[9] = 0.29078;

  // Create constraints.
  testRobotDirect<roboptim::EigenMatrixDense>::intervals_t bounds;
  solver_t::problem_t::scales_t scales;
  bounds.push_back(roboptim::Function::makeInterval (0., 0.));
	bounds.push_back(roboptim::Function::makeInterval (0., 0.));
	bounds.push_back(roboptim::Function::makeInterval (0., 0.));
  scales.push_back(1.);
	scales.push_back(1.);
	scales.push_back(1.);
  pb.addConstraint ( endEffCstr, bounds, scales);

  pb.startingPoint () = start;
  roboptim::SolverFactory<solver_t> factory ("cfsqp", pb);
  solver_t& solver = factory ();

  solver_t::result_t res = solver.minimum ();

  
  std::cout << solver << std::endl;

  // Process the result
  switch (res.which ())
    {
    case solver_t::SOLVER_VALUE:
      {
        // Get the result.
	roboptim::Result& result =
	  boost::get<roboptim::Result> (res);

        // Display the result.
	std::cout << "A solution has been found: " << std::endl
                  << result << std::endl;

        return 0;
      }

    case solver_t::SOLVER_VALUE_WARNINGS:
      {
        // Get the result.
        roboptim::ResultWithWarnings& result =
	  boost::get<roboptim::ResultWithWarnings> (res);

        // Display the result.
	std::cout << "A solution has been found: " << std::endl
                  << result << std::endl;

        return 0;
      }

    case solver_t::SOLVER_NO_SOLUTION:
    case solver_t::SOLVER_ERROR:
      {
	std::cout << "A solution should have been found. Failing..."
                  << std::endl
                  << boost::get<roboptim::SolverError> (res).what ()
                  << std::endl;

        return 2;
      }
    }

  return 0;
}
